import React from 'react';

const Blog = () => {
  const blogData = [
    {
      id: 1,
      image: 'https://placekitten.com/300/200',
      topic: 'Blog Post 1',
    },
    {
      id: 2,
      image: 'https://placekitten.com/300/201',
      topic: 'Blog Post 2',
    },
    {
      id: 3,
      image: 'https://placekitten.com/300/202',
      topic: 'Blog Post 3',
    },
    // Add more blog data as needed
  ];

  return (
    <section className="blog-section">
      <div className="container">
        <h2 className="section-heading">Blog</h2>
        <div className="row">
          {blogData.map((blog) => (
            <div key={blog.id} className="col-lg-4 col-md-6 col-sm-12 mb-4">
              <div className="card">
                <img src={blog.image} alt={`Blog Post ${blog.id}`} className="card-img-top" />
                <div className="card-body">
                  <h5 className="card-title">{blog.topic}</h5>
                  {/* Add additional card content if needed */}
                </div>
              </div>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default Blog;
